 ,(151,'','2014-07-06 17:40:39','2014-07-06 17:40:39',NULL,'1',9,1,'O:11:\"BlockRecord\":11:{s:5:\"_dbat\";i:1;s:6:\"_table\";s:14:\"btContentLocal\";s:8:\"_tableat\";s:14:\"btContentLocal\";s:6:\"_where\";s:7:\"bID=151\";s:6:\"_saved\";b:1;s:8:\"_lasterr\";b:0;s:9:\"_original\";a:2:{i:0;s:3:\"151\";i:1;s:1585:\"<h2>Welcome to Cardiff Ski Club</h2>\r\n<p><span>Cardiff Ski Racing Club is for children and adults who want to improve their overall skiing technique and competitive race performance.</span></p>\r\n<p><span><span>We are a friendly family orientated Club with a structured coaching programme delivered by fully qualified professional coaches and instructors. We welcome all levels of skiers and, provided you’ve mastered the basics, we can take you to the level you want to get to and are capable of achieving.</span></span></p>\r\n<p><span>We train 41 Tuesdays a year from 6:00pm to 7:30pm at the </span><a href=\"http://www.skicardiff.com/\" target=\"_blank\">Cardiff Ski &amp; Snowboard Centre</a><span>, which has an artificial ski slope in the heart of the city near Fairwater Park.</span></p>\r\n<p><span><span>Our Membership ranges from those who have just mastered the snowplough right through to several Members of the Welsh Ski Squad and several who hold National and European age group titles. So whatever your ability, </span>please come along and join us<span>. Although we focus on improving your overall skiing technique and ski racing; it’s also about having fun and being part of a friendly supportive team.</span></span></p>\r\n<p><span><span><span>The Club is affiliated with our National governing body; </span><a href=\"http://www.snowsportwales.net/\" target=\"_blank\">Snowsport Wales</a><span> and partners with </span><a href=\"http://www.dragonsalpine.com/\" target=\"_blank\">Dragons Alpine Ski Club</a><span> for snow based training and racing.</span></span></span></p>\";}s:11:\"foreignName\";s:11:\"blockrecord\";s:8:\"lockMode\";s:12:\" for update \";s:3:\"bID\";s:3:\"151\";s:7:\"content\";s:1585:\"<h2>Welcome to Cardiff Ski Club</h2>\r\n<p><span>Cardiff Ski Racing Club is for children and adults who want to improve their overall skiing technique and competitive race performance.</span></p>\r\n<p><span><span>We are a friendly family orientated Club with a structured coaching programme delivered by fully qualified professional coaches and instructors. We welcome all levels of skiers and, provided you’ve mastered the basics, we can take you to the level you want to get to and are capable of achieving.</span></span></p>\r\n<p><span>We train 41 Tuesdays a year from 6:00pm to 7:30pm at the </span><a href=\"http://www.skicardiff.com/\" target=\"_blank\">Cardiff Ski &amp; Snowboard Centre</a><span>, which has an artificial ski slope in the heart of the city near Fairwater Park.</span></p>\r\n<p><span><span>Our Membership ranges from those who have just mastered the snowplough right through to several Members of the Welsh Ski Squad and several who hold National and European age group titles. So whatever your ability, </span>please come along and join us<span>. Although we focus on improving your overall skiing technique and ski racing; it’s also about having fun and being part of a friendly supportive team.</span></span></p>\r\n<p><span><span><span>The Club is affiliated with our National governing body; </span><a href=\"http://www.snowsportwales.net/\" target=\"_blank\">Snowsport Wales</a><span> and partners with </span><a href=\"http://www.dragonsalpine.com/\" target=\"_blank\">Dragons Alpine Ski Club</a><span> for snow based training and racing.</span></span></span></p>\";}')
