 ,(245,NULL,'2015-02-07 15:17:32','2015-02-07 15:17:56',NULL,'1',9,1,'O:11:\"BlockRecord\":11:{s:5:\"_dbat\";i:1;s:6:\"_table\";s:14:\"btContentLocal\";s:8:\"_tableat\";s:14:\"btContentLocal\";s:6:\"_where\";s:7:\"bID=245\";s:6:\"_saved\";b:1;s:8:\"_lasterr\";b:0;s:9:\"_original\";a:2:{i:0;s:3:\"245\";i:1;s:4638:\"<p>This guide is intended to give you an idea of the different races available on artificial ski slopes in the UK.  It is not intended to be a definitive guide, but hopefully it will give you a flavour and whet your appetite for getting started.</p>\r\n<p>There are in the main two types of race: un-seeded and seeded races.</p>\r\n<p>For Details of races this year please visit <a href=\"http://www.britski.org\" target=\"_blank\">www.britski.org</a></p>\r\n<p><strong>Un-seeded Races</strong></p>\r\n<p>You do not need to be registered with a UK National governing body, eg Snowsport Wales, to enter these events and are a good introduction to ski racing. Un-seeded races include schools’ championships and the Gloucester Summer Race League. Seeded racers can enter the un-seeded races, but may be restricted depending on a skiers seed points.</p>\r\n<p><strong>Seeded Races</strong></p>\r\n<p>These are only open to ski racers registered with a UK National governing body, eg Snowsport Wales, and the results of all races are recorded centrally. All registered ski racers have a seed point score and these are adjusted from time to time to reflect race results (more about this later). The seeded races include Club Nationals, Grand Prix races and National Championships. Certain races have seed point restrictions.</p>\r\n<table border=\"0\" cellspacing=\"5\" cellpadding=\"10\" align=\"left\">\r\n<tbody>\r\n<tr style=\"background-color: #4e73bd;\">\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Race</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Seeded</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Seed Point Exclusions</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Description</td>\r\n</tr>\r\n<tr style=\"padding: 10px;\">\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Schools Championships</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">No</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">None</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Practice through course allowed. Two runs through same course.</td>\r\n</tr>\r\n<tr style=\"background-color: #cdd6de; padding: 10px;\">\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Gloucester Summer Race League</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">No</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">\r\n<p>None</p>\r\n</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Practice through course allowed. Two runs through same slalom course. Followed by dual slalom, 3 runs through same course.</td>\r\n</tr>\r\n<tr style=\"padding: 10px;\">\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Club Nationals</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Yes</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">None</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Practice through course NOT allowed only course inspection. Three runs through same course, with best time of either of the first two runs plus the third run time to count to total time OR two runs both counting.</td>\r\n</tr>\r\n<tr style=\"background-color: #cdd6de; padding: 10px;\">\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">GBR Indoor &amp; Outdoor Series Races</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Yes</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">None</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Practice through course NOT allowed. Course inspection. One run through course, course changed. Another course inspection and run through second course.</td>\r\n</tr>\r\n<tr style=\"padding: 10px;\">\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Welsh &amp; Irish Championships</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Yes</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">None</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Practice through course NOT allowed. Course inspection. One run through course, course changed. Another course inspection and run through second course. Combined times for both runs count.</td>\r\n</tr>\r\n<tr style=\"background-color: #cdd6de; padding: 10px;\">\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">English, Scottish &amp; European Championships</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Yes</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">&gt;250</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Practice through course NOT allowed. Course inspection. One run through course, course changed. Another course inspection and run through second course. Combined times for both runs count.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p> </p>\";}s:11:\"foreignName\";s:11:\"blockrecord\";s:8:\"lockMode\";s:12:\" for update \";s:3:\"bID\";s:3:\"245\";s:7:\"content\";s:4638:\"<p>This guide is intended to give you an idea of the different races available on artificial ski slopes in the UK.  It is not intended to be a definitive guide, but hopefully it will give you a flavour and whet your appetite for getting started.</p>\r\n<p>There are in the main two types of race: un-seeded and seeded races.</p>\r\n<p>For Details of races this year please visit <a href=\"http://www.britski.org\" target=\"_blank\">www.britski.org</a></p>\r\n<p><strong>Un-seeded Races</strong></p>\r\n<p>You do not need to be registered with a UK National governing body, eg Snowsport Wales, to enter these events and are a good introduction to ski racing. Un-seeded races include schools’ championships and the Gloucester Summer Race League. Seeded racers can enter the un-seeded races, but may be restricted depending on a skiers seed points.</p>\r\n<p><strong>Seeded Races</strong></p>\r\n<p>These are only open to ski racers registered with a UK National governing body, eg Snowsport Wales, and the results of all races are recorded centrally. All registered ski racers have a seed point score and these are adjusted from time to time to reflect race results (more about this later). The seeded races include Club Nationals, Grand Prix races and National Championships. Certain races have seed point restrictions.</p>\r\n<table border=\"0\" cellspacing=\"5\" cellpadding=\"10\" align=\"left\">\r\n<tbody>\r\n<tr style=\"background-color: #4e73bd;\">\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Race</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Seeded</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Seed Point Exclusions</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Description</td>\r\n</tr>\r\n<tr style=\"padding: 10px;\">\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Schools Championships</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">No</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">None</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Practice through course allowed. Two runs through same course.</td>\r\n</tr>\r\n<tr style=\"background-color: #cdd6de; padding: 10px;\">\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Gloucester Summer Race League</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">No</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">\r\n<p>None</p>\r\n</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Practice through course allowed. Two runs through same slalom course. Followed by dual slalom, 3 runs through same course.</td>\r\n</tr>\r\n<tr style=\"padding: 10px;\">\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Club Nationals</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Yes</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">None</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Practice through course NOT allowed only course inspection. Three runs through same course, with best time of either of the first two runs plus the third run time to count to total time OR two runs both counting.</td>\r\n</tr>\r\n<tr style=\"background-color: #cdd6de; padding: 10px;\">\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">GBR Indoor &amp; Outdoor Series Races</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Yes</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">None</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Practice through course NOT allowed. Course inspection. One run through course, course changed. Another course inspection and run through second course.</td>\r\n</tr>\r\n<tr style=\"padding: 10px;\">\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Welsh &amp; Irish Championships</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Yes</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">None</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Practice through course NOT allowed. Course inspection. One run through course, course changed. Another course inspection and run through second course. Combined times for both runs count.</td>\r\n</tr>\r\n<tr style=\"background-color: #cdd6de; padding: 10px;\">\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">English, Scottish &amp; European Championships</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Yes</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">&gt;250</td>\r\n<td style=\"padding: 10px;\" align=\"left\" valign=\"top\">Practice through course NOT allowed. Course inspection. One run through course, course changed. Another course inspection and run through second course. Combined times for both runs count.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p> </p>\";}')
