INSERT INTO CollectionVersionBlocksOutputCache VALUES(175,3,280,'Main','	<div class=\"ccm-ui\">\n			<a href=\"/index.php/tools/packages/proevents/invite_dialog.php?ccID=175&uID=1\" id=\"event_invite\" alt=\"event_envite\" class=\"dialog-launch btn info invite\" dialog-width=\"300\" dialog-height=\"120\" dialog-modal=\"true\" dialog-title=\"Event Invite\" dialog-on-close=\"\" onClick=\"javascript:;\">Invite Others</a>\n			</div>\n	<div class=\"event-attributes\">\n		<div>\n			<h2>Excel Race Pontypool </h2>\n			<div class=\"date-times\">\n			Mar 14th 1:00 pm - 5:00 pm<br/> \n			</div>\n			<div class=\"date-social\">\n						<span class=\'st_twitter_hcount\' displayText=\'Tweet\'></span>\n						<span class=\'st_facebook_hcount\' displayText=\'Facebook\'></span>\n						<script type=\"text/javascript\">var switchTo5x=true;</script>\n			<script type=\"text/javascript\" src=\"https://w.sharethis.com/button/buttons.js\"></script>\n			<script type=\"text/javascript\">stLight.options({publisher:\"\"});</script>\n						</div>\n			<h5>						</h5>\n			<div id=\"deswrap\">\n				<div id=\"description\">\n					<p>We invite racers to compete in the above event to be held at the Pontypool Ski Centre Saturday 14<sup>th</sup> March 2015, starting at 1pm.  This event format includes 3 runs down one course with the fastest time to count, and is designed to serve the purpose of providing local development entry level race opportunities.</p>				</div>\n			</div>\n			<div id=\"eventfoot\">\n			  			</div>\n			<div id=\"iCal\">\n				<p>\n					<img src=\"/packages/proevents/blocks/pro_event_list//tools/calendar_sml.png\" width=\"25\" alt=\"iCal feed\" />&nbsp;&nbsp;\n					<a href=\"/index.php/tools/blocks/pro_event_list/iCal.php?ctID=12&bID=280&ordering=&eID=1\" id=\"getFeed\">\n				get iCal link</a>\n				</p>\n			</div>\n			<div id=\"tags\">\n			Tags: <i>\n			<a href=\"http://www.cardiffskiclub.co.uk?akID[24][atSelectOptionID][]=13\">Excel</a>&nbsp;&nbsp;<a href=\"http://www.cardiffskiclub.co.uk?akID[24][atSelectOptionID][]=14\">Race</a>&nbsp;&nbsp;			</i>\n			</div>\n		</div>\n	</div>\n			<script type=\"text/javascript\">\n		/*<![CDATA[*/\n		$(document).ready(function(){\n			$(\'#event_invite\').dialog();\n		});\n		/*]]>*/\n		</script>\n		',1581155636)
