 ,(154,1,'Excel Race','excel-race-1','Pontypool 1pm. The Excel Event format provides a great opportunity for new and developing competitors to get in some excellent race experience without the pressure of having to finish every run.  The format gives three runs and its the fastest run to count.  The races are run in just a few hours of an afternoon to avoid the need for overnight stops.  There are no medals and no prize giving to chase after, it is just about going as fast as you can!','2015-03-14 16:00:00','2015-02-07 16:02:33','Initial Version',0,0,1,1,4,11,NULL)
