 ,(1,'Welcome to Cardiff Ski Club\r\n Cardiff Ski Racing Club is for children and adults who want to improve their overall skiing technique and competitive race performance. \r\n We are a friendly family orientated Club with a structured coaching programme delivered by fully qualified professional coaches and instructors. We welcome all levels of skiers and, provided you’ve mastered the basics, we can take you to the level you want to get to and are capable of achieving. \r\n We train 41 Tuesdays a year from 6:00pm to 7:30pm at the Cardiff Ski & Snowboard Centre, which has an artificial ski slope in the heart of the city near Fairwater Park. \r\n Our Membership ranges from those who have just mastered the snowplough right through to several Members of the Welsh Ski Squad and several who hold National and European age group titles. So whatever your ability, please come along and join us. Although we focus on improving your overall skiing technique and ski racing; it’s also about having fun and being part of a friendly supportive team. \r\n The Club is affiliated with our National governing body; Snowsport Wales and partners with Dragons Alpine Ski Club for snow based training and racing.      Cardiff Ski Club is Sponsored by:                             ','Home','',NULL,'2014-07-05 09:29:30','2015-02-07 15:26:47',NULL,0)
