 ,(129,'    Coaching Programme     Joining Cardiff Ski Club\r\n As you can see we have skiers of all abilities in the club and we are very keen to see new members of all ages come and join one of the most successful ski clubs in the UK. \r\n We train for 40 weeks a year on a Tuesday evening between 6pm and 7-30pm. \r\n We have three professional coaches who will assess your child’s ability during your first few lessons and they will be trained in the appropriate group. It is worth mentioning at this stage that dry slope skiing can feel quite different to snow and it may take a few weeks for your child to adjust, we would encourage you to try and give it a few weeks for your child to get used to the new surface. \r\n We hire the slope from the ski centre for our 1.5hrs of training so all fees taken are fed directly back into club funds. The hire of equipment is included in your membership. \r\n There are several ways to pay for your membership that I have outlined below: \r\n\r\nGuest fee = £15 per session (max 2 sessions).\r\nAnnual Membership fee = £40 + £10 per session.\r\nMonthly Standing Order = £25 per month (the cheapest option).\r\nAnnual fee = £300 per year paid in advance.\r\n\r\n Please note we only accept payment by cash or cheque. \r\n We have a committee made up of parents and coaches so please feel free to approach any of the following if you have any questions. \r\n Richard Hyett – Chairman - Richard.Hyett at cardiff.gov.uk \r\n Cathy Jones – Secretary - cath.jnz at gmail.com \r\n Rowena Criddle – Treasurer - rowena at criddle.com \r\n Robin Kellen – Head coach - robin at snowsportwales.net  ','About','','/about','2014-07-05 09:29:56','2015-02-07 17:25:40',NULL,0)
