 ,(141,'Racing Guide     Getting Started Seed Points  This guide is intended to give you an idea of the different races available on artificial ski slopes in the UK.  It is not intended to be a definitive guide, but hopefully it will give you a flavour and whet your appetite for getting started. \r\n There are in the main two types of race: un-seeded and seeded races. \r\n For Details of races this year please visit www.britski.org \r\n Un-seeded Races \r\n You do not need to be registered with a UK National governing body, eg Snowsport Wales, to enter these events and are a good introduction to ski racing. Un-seeded races include schools’ championships and the Gloucester Summer Race League. Seeded racers can enter the un-seeded races, but may be restricted depending on a skiers seed points. \r\n Seeded Races \r\n These are only open to ski racers registered with a UK National governing body, eg Snowsport Wales, and the results of all races are recorded centrally. All registered ski racers have a seed point score and these are adjusted from time to time to reflect race results (more about this later). The seeded races include Club Nationals, Grand Prix races and National Championships. Certain races have seed point restrictions. \r\n\r\n\r\n\r\nRace\r\nSeeded\r\nSeed Point Exclusions\r\nDescription\r\n\r\n\r\nSchools Championships\r\nNo\r\nNone\r\nPractice through course allowed. Two runs through same course.\r\n\r\n\r\nGloucester Summer Race League\r\nNo\r\n\r\n None \r\n\r\nPractice through course allowed. Two runs through same slalom course. Followed by dual slalom, 3 runs through same course.\r\n\r\n\r\nClub Nationals\r\nYes\r\nNone\r\nPractice through course NOT allowed only course inspection. Three runs through same course, with best time of either of the first two runs plus the third run time to count to total time OR two runs both counting.\r\n\r\n\r\nGBR Indoor & Outdoor Series Races\r\nYes\r\nNone\r\nPractice through course NOT allowed. Course inspection. One run through course, course changed. Another course inspection and run through second course.\r\n\r\n\r\nWelsh & Irish Championships\r\nYes\r\nNone\r\nPractice through course NOT allowed. Course inspection. One run through course, course changed. Another course inspection and run through second course. Combined times for both runs count.\r\n\r\n\r\nEnglish, Scottish & European Championships\r\nYes\r\n>250\r\nPractice through course NOT allowed. Course inspection. One run through course, course changed. Another course inspection and run through second course. Combined times for both runs count.\r\n\r\n\r\n\r\n    ','Racing','Racing Guide','/racing-guide','2014-07-06 13:43:00','2015-02-07 15:18:05',NULL,0)
