 ,(142,'Coaching Programme\r\n We run a structured coaching and training programme, with the emphasis changing dependent on the time of year and the specific needs of our skiers. We change the emphasis from core skiing skills to specific racing skills. \r\n Autumn \r\n Racing \r\n\r\nMajor National Championships.\r\nSchools Championships.\r\nClub Championship.\r\n\r\n Training \r\n\r\nTechnical development drills 40% / Gates 60%.\r\nFor those who are racing in National competitions: lots of gate practice on tough courses.\r\nExpect children from schools at training in preparation for the schools championships – easy courses.\r\n\r\n Emphasis \r\n\r\nPreparation for National and Schools Championships.\r\n\r\n Issues \r\n\r\nLots of new children coming along for a couple of weeks.\r\nProviding the right course for each group.\r\nSetting up and running timing.\r\nEnsuring programmes for new Club Members.\r\n\r\n Winter \r\n Racing \r\n\r\nSome have snow races.\r\n\r\n Training \r\n\r\nTechnical development drills 80% / Gates 20%.\r\nConcentrate on developing the technical and skiing skills of athletes outside of gates.\r\nGroups work at appropriate level for skill and age.\r\n\r\n Emphasis \r\n\r\nDeveloping skiing skills.\r\n\r\n Issues \r\n\r\nAthletes should spend 80% of time training and 20% of time race training.\r\nTraining time will be split 80% technical training and 20% gates.\r\n\r\n Spring \r\n Racing \r\n\r\nSome athletes have snow races.\r\nStart of the artificial slope racing season.\r\nRegional schools race.\r\n\r\n Training \r\n\r\nTechnical development drills 70% / Gates 30%.\r\nConcentrate on developing the technical and skiing skills of athletes outside of gates.\r\nTransfer skills to gates.\r\nGroups work at appropriate level for skill and age.\r\nPreparation for schools race – easy courses.\r\n\r\n Emphasis \r\n\r\nDeveloping skiing skills.\r\nTransfer skills to gates.\r\nStart preparation for race season.\r\n\r\n Issues \r\n\r\nAthletes should spend 80% of time training and 20% of time race training.\r\nTraining time will be split 70% technical training and 30% gates.\r\nNew registrations.\r\nLots of new children coming along for a couple of weeks.\r\n\r\n Summer \r\n Racing \r\n\r\nArtificial slope racing season.\r\n\r\n Training \r\n\r\nTechnical development drills 50% / Gates 50%.\r\nConcentrate on developing the technical and skiing skills of athletes outside of gates.\r\nGroups work at appropriate level for skill and age.\r\n\r\n Emphasis \r\n\r\nContinue preparation for race season.\r\nEvaluate early performances and amend training as necessary.\r\n\r\n Issues \r\n\r\nTime for individual feedback.\r\nSetting up and running timing.\r\nEnsuring programmes for new Club Members.\r\n         Joining ','Training','Training','/about/training','2014-07-06 14:36:00','2015-02-07 13:32:14',NULL,0)
 ,(150,'    Racing Guide Seed Points Coming soon...\r\n All you need to know about getting going.  ','Getting Started','Getting Started','/racing-guide/getting-started','2015-02-07 11:40:00','2015-02-07 15:13:48',NULL,0)
 ,(151,'Seed Points\r\n Everyone starts with 999.99 Seed Points at the beginning of their racing career and the aim is to keep bringing your points down as you improve.  Your Seed Points at the end of each year are usually carried forward as your starting Seed Points for the following year. There is a Race Point calculation for each seeded race and this information is used to calculate the Seed Points.  Male and Female Race Points and Seed Points are calculated separately.  The top racers at the end of the year will have 0.00 Seed Points - there is only one Male and one Female racer with 0.00 Seed Points. \r\n Race Points and race Results calculation \r\n \'F\' - this is a value given by the International Ski Federation and is used in all races. \r\n Race Points = (Competirors Time / Winners Time) - 1 * F \r\n Race Penalty Point - this is a value calculated from the Seed Points of the best seeded starters and the best seeded finishers. This is calculated as follows. \r\n(A + B - C) / 10 \r\nA = the sum of the Seed Points of the 5 best seeded competitors in the first 10 finishers \r\nB = the sum of the Seed Points of the 5 best seeded starters \r\nC = the sum of the Race Points of the 5 best seeded competitors in the first 10 finishers \r\n There are minimum Race Penalty Points as follows. \r\n0 - Open National & European Championships \r\n5 - Closed National Championships, Grand Prix races and Club Nationals (2 run) \r\n10 - Club Nationals (3 run) \r\n The Result for each race is the competitors Race Points added to the Race Penalty Points. \r\n Seed Points calculation \r\n There are two calculations: (i) mid-season; and (ii) end of season.      Racing Guide Getting Started ','Seed Points','','/racing-guide/seed-points','2015-02-07 11:53:00','2015-02-07 13:30:01',NULL,0)
 ,(163,'','Events',NULL,'/event','2015-02-07 17:54:31','2015-02-07 18:47:30',NULL,0)
 ,(152,'','Calendar','event calendar','/calendar','2015-02-07 15:45:00','2015-02-07 16:57:27',NULL,0)
 ,(154,'Excel Event Race Pontypool 1pm.\r\n The Excel Event format provides a great opportunity for new and developing competitors to get in some excellent race experience without the pressure of having to finish every run.  The format gives three runs and its the fastest run to count.  The races are run in just a few hours of an afternoon to avoid the need for overnight stops.  There are no medals and no prize giving to chase after, it is just about going as fast as you can!  ','Excel Race','','/calendar/excel-race-1','2015-03-14 13:00:00','2015-02-07 16:19:25',NULL,0);

