 ,(118,'<h1>Racing Guide</h1>\r\n<p> </p>\r\n<p><br /> This guide is intended to give you an idea of the different races available on artificial ski slopes in the UK.  It is not intended to be a definitive guide, but hopefully it will give you a flavour and whet your appetite for getting started.</p>\r\n<p> </p>\r\n<p><br /> There are in the main two types of race: un-seeded and seeded races.</p>\r\n<p> </p>\r\n<p><br /> For Details of races this year please visit <a href=\"http://www.britski.org\" target=\"_blank\">www.britski.org</a></p>\r\n<p> </p>\r\n<p><br /> <strong>Un-seeded Races</strong></p>\r\n<p> </p>\r\n<p><br /> You do not need to be registered with a UK National governing body, eg Snowsport Wales, to enter these events and are a good introduction to ski racing. Un-seeded races include schools’ championships and the Gloucester Summer Race League. Seeded racers can enter the un-seeded races, but may be restricted depending on a skiers seed points.</p>\r\n<p> </p>\r\n<p><br /> <strong>Seeded Races</strong></p>\r\n<p> </p>\r\n<p><br /> These are only open to ski racers registered with a UK National governing body, eg Snowsport Wales, and the results of all races are recorded centrally. All registered ski racers have a seed point score and these are adjusted from time to time to reflect race results (more about this later). The seeded races include Club Nationals, Grand Prix races and National Championships. Certain races have seed point restrictions.</p>\r\n<p> </p>\r\n<table border=\"0\" cellpadding=\"10\" align=\"left\">\r\n<tbody>\r\n<tr style=\"background-color: #ffff99;\">\r\n<td align=\"left\" valign=\"top\"><br /> Race</td>\r\n<td align=\"left\" valign=\"top\"><br />\r\n<p><br /> Seeded</p>\r\n</td>\r\n<td align=\"left\" valign=\"top\"><br />\r\n<p><br /> Seed Point Exclusions</p>\r\n</td>\r\n<td align=\"left\" valign=\"top\"><br /> Description</td>\r\n</tr>\r\n<tr>\r\n<td align=\"left\" valign=\"top\"><br /> Schools Championships</td>\r\n<td align=\"left\" valign=\"top\"><br /> No</td>\r\n<td align=\"left\" valign=\"top\"><br /> None</td>\r\n<td align=\"left\" valign=\"top\"><br /> Practice through course allowed. Two runs through same course.</td>\r\n</tr>\r\n<tr style=\"background-color: #ccffff;\">\r\n<td align=\"left\" valign=\"top\"><br /> Gloucester Summer Race League</td>\r\n<td align=\"left\" valign=\"top\"><br /> No</td>\r\n<td align=\"left\" valign=\"top\"><br />\r\n<p><br /> Males &lt;160</p>\r\n<br />\r\n<p><br /> Females &lt;125</p>\r\n</td>\r\n<td align=\"left\" valign=\"top\"><br /> Practice through course allowed. Two runs through same slalom course. Followed by dual slalom, 3 runs through came course.</td>\r\n</tr>\r\n<tr>\r\n<td align=\"left\" valign=\"top\"><br /> Club Nationals</td>\r\n<td align=\"left\" valign=\"top\"><br /> Yes</td>\r\n<td align=\"left\" valign=\"top\"><br /> None</td>\r\n<td align=\"left\" valign=\"top\"><br /> Practice through course NOT allowed only course inspection. Three runs through same course, with best time of either of the first two runs plus the third run time to count to total time OR two runs both counting.</td>\r\n</tr>\r\n<tr style=\"background-color: #ccffff;\">\r\n<td align=\"left\" valign=\"top\"><br /> GBR Indoor &amp; Outdoor Series Races</td>\r\n<td align=\"left\" valign=\"top\"><br /> Yes</td>\r\n<td align=\"left\" valign=\"top\"><br /> None</td>\r\n<td align=\"left\" valign=\"top\"><br /> Practice through course NOT allowed. Course inspection. One run through course, course changed. Another course inspection and run through second course.</td>\r\n</tr>\r\n<tr>\r\n<td align=\"left\" valign=\"top\"><br /> Welsh &amp; Irish Championships</td>\r\n<td align=\"left\" valign=\"top\"><br /> Yes</td>\r\n<td align=\"left\" valign=\"top\"><br /> None</td>\r\n<td align=\"left\" valign=\"top\"><br /> Practice through course NOT allowed. Course inspection. One run through course, course changed. Another course inspection and run through second course. Combined times for both runs count.</td>\r\n</tr>\r\n<tr style=\"background-color: #ccffff;\">\r\n<td align=\"left\" valign=\"top\"><br /> English, Scottish &amp; European Championships</td>\r\n<td align=\"left\" valign=\"top\"><br /> Yes</td>\r\n<td align=\"left\" valign=\"top\"><br /> &gt;250</td>\r\n<td align=\"left\" valign=\"top\"><br /> Practice through course NOT allowed. Course inspection. One run through course, course changed. Another course inspection and run through second course. Combined times for both runs count.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p> </p>\r\n<p><br />  </p>\r\n<p> </p>\r\n<p><br /> <strong>Seed Points</strong></p>\r\n<p> </p>\r\n<p><br /> Everyone starts with 999.99 Seed Points at the beginning of their racing career and the aim is to keep bringing your points down as you improve.  Your Seed Points at the end of each year are usually carried forward as your starting Seed Points for the following year. There is a Race Point calculation for each seeded race and this information is used to calculate the Seed Points.  Male and Female Race Points and Seed Points are calculated separately.  The top racers at the end of the year will have 0.00 Seed Points - there is only one Male and one Female racer with 0.00 Seed Points.</p>\r\n<p> </p>\r\n<p><br /> <strong>Race Points and race Results calculation</strong></p>\r\n<p> </p>\r\n<p><br /> \'F\' - this is a value given by the International Ski Federation and is used in all races.</p>\r\n<p> </p>\r\n<p><br /> Race Points = (Competirors Time / Winners Time) - 1 * F</p>\r\n<p> </p>\r\n<p><br /> Race Penalty Point - this is a value calculated from the Seed Points of the best seeded starters and the best seeded finishers. This is calculated as follows.</p>\r\n<p> </p>\r\n<p style=\"padding-left: 30px;\"><br /> (A + B - C) / 10</p>\r\n<p> </p>\r\n<p style=\"padding-left: 30px;\"><br /> A = the sum of the Seed Points of the 5 best seeded competitors in the first 10 finishers</p>\r\n<p> </p>\r\n<p style=\"padding-left: 30px;\"><br /> B = the sum of the Seed Points of the 5 best seeded starters</p>\r\n<p> </p>\r\n<p style=\"padding-left: 30px;\"><br /> C = the sum of the Race Points of the 5 best seeded competitors in the first 10 finishers</p>\r\n<p> </p>\r\n<p><br /> There are minimum Race Penalty Points as follows.</p>\r\n<p> </p>\r\n<p style=\"padding-left: 30px;\"><br /> 0 - Open National &amp; European Championships</p>\r\n<p> </p>\r\n<p style=\"padding-left: 30px;\"><br /> 5 - Closed National Championships, Grand Prix races and Club Nationals (2 run)</p>\r\n<p> </p>\r\n<p style=\"padding-left: 30px;\"><br /> 10 - Club Nationals (3 run)</p>\r\n<p> </p>\r\n<p><br /> The Result for each race is the competitors Race Points added to the Race Penalty Points.</p>\r\n<p> </p>\r\n<p><br /> <strong>Seed Points calculation</strong></p>\r\n<p> </p>\r\n<p><br /> There are two calculations: (i) mid-season; and (ii) end of season.</p>')
 ,(119,'<h1>Racing Guide</h1>\r\n<p>This guide is intended to give you an idea of the different races available on artificial ski slopes in the UK.  It is not intended to be a definitive guide, but hopefully it will give you a flavour and whet your appetite for getting started.</p>\r\n<p>There are in the main two types of race: un-seeded and seeded races.</p>\r\n<p>For Details of races this year please visit <a href=\"http://www.britski.org\" target=\"_blank\">www.britski.org</a></p>\r\n<p><strong>Un-seeded Races</strong></p>\r\n<p>You do not need to be registered with a UK National governing body, eg Snowsport Wales, to enter these events and are a good introduction to ski racing. Un-seeded races include schools’ championships and the Gloucester Summer Race League. Seeded racers can enter the un-seeded races, but may be restricted depending on a skiers seed points.</p>\r\n<p><strong>Seeded Races</strong></p>\r\n<p>These are only open to ski racers registered with a UK National governing body, eg Snowsport Wales, and the results of all races are recorded centrally. All registered ski racers have a seed point score and these are adjusted from time to time to reflect race results (more about this later). The seeded races include Club Nationals, Grand Prix races and National Championships. Certain races have seed point restrictions.</p>\r\n<table border=\"0\" cellpadding=\"10\" align=\"left\">\r\n<tbody>\r\n<tr style=\"background-color: #ffff99;\">\r\n<td align=\"left\" valign=\"top\">Race</td>\r\n<td align=\"left\" valign=\"top\">\r\n<p>Seeded</p>\r\n</td>\r\n<td align=\"left\" valign=\"top\">\r\n<p>Seed Point Exclusions</p>\r\n</td>\r\n<td align=\"left\" valign=\"top\">Description</td>\r\n</tr>\r\n<tr>\r\n<td align=\"left\" valign=\"top\">Schools Championships</td>\r\n<td align=\"left\" valign=\"top\">No</td>\r\n<td align=\"left\" valign=\"top\">None</td>\r\n<td align=\"left\" valign=\"top\">Practice through course allowed. Two runs through same course.</td>\r\n</tr>\r\n<tr style=\"background-color: #ccffff;\">\r\n<td align=\"left\" valign=\"top\">Gloucester Summer Race League</td>\r\n<td align=\"left\" valign=\"top\">No</td>\r\n<td align=\"left\" valign=\"top\">\r\n<p>Males</p>\r\n<p>Females</p>\r\n</td>\r\n<td align=\"left\" valign=\"top\">Practice through course allowed. Two runs through same slalom course. Followed by dual slalom, 3 runs through came course.</td>\r\n</tr>\r\n<tr>\r\n<td align=\"left\" valign=\"top\">Club Nationals</td>\r\n<td align=\"left\" valign=\"top\">Yes</td>\r\n<td align=\"left\" valign=\"top\">None</td>\r\n<td align=\"left\" valign=\"top\">Practice through course NOT allowed only course inspection. Three runs through same course, with best time of either of the first two runs plus the third run time to count to total time OR two runs both counting.</td>\r\n</tr>\r\n<tr style=\"background-color: #ccffff;\">\r\n<td align=\"left\" valign=\"top\">GBR Indoor &amp; Outdoor Series Races</td>\r\n<td align=\"left\" valign=\"top\">Yes</td>\r\n<td align=\"left\" valign=\"top\">None</td>\r\n<td align=\"left\" valign=\"top\">Practice through course NOT allowed. Course inspection. One run through course, course changed. Another course inspection and run through second course.</td>\r\n</tr>\r\n<tr>\r\n<td align=\"left\" valign=\"top\">Welsh &amp; Irish Championships</td>\r\n<td align=\"left\" valign=\"top\">Yes</td>\r\n<td align=\"left\" valign=\"top\">None</td>\r\n<td align=\"left\" valign=\"top\">Practice through course NOT allowed. Course inspection. One run through course, course changed. Another course inspection and run through second course. Combined times for both runs count.</td>\r\n</tr>\r\n<tr style=\"background-color: #ccffff;\">\r\n<td align=\"left\" valign=\"top\">English, Scottish &amp; European Championships</td>\r\n<td align=\"left\" valign=\"top\">Yes</td>\r\n<td align=\"left\" valign=\"top\">&gt;250</td>\r\n<td align=\"left\" valign=\"top\">Practice through course NOT allowed. Course inspection. One run through course, course changed. Another course inspection and run through second course. Combined times for both runs count.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p> </p>\r\n<p><strong>Seed Points</strong></p>\r\n<p>Everyone starts with 999.99 Seed Points at the beginning of their racing career and the aim is to keep bringing your points down as you improve.  Your Seed Points at the end of each year are usually carried forward as your starting Seed Points for the following year. There is a Race Point calculation for each seeded race and this information is used to calculate the Seed Points.  Male and Female Race Points and Seed Points are calculated separately.  The top racers at the end of the year will have 0.00 Seed Points - there is only one Male and one Female racer with 0.00 Seed Points.</p>\r\n<p><strong>Race Points and race Results calculation</strong></p>\r\n<p>\'F\' - this is a value given by the International Ski Federation and is used in all races.</p>\r\n<p>Race Points = (Competirors Time / Winners Time) - 1 * F</p>\r\n<p>Race Penalty Point - this is a value calculated from the Seed Points of the best seeded starters and the best seeded finishers. This is calculated as follows.</p>\r\n<p style=\"padding-left: 30px;\">(A + B - C) / 10</p>\r\n<p style=\"padding-left: 30px;\">A = the sum of the Seed Points of the 5 best seeded competitors in the first 10 finishers</p>\r\n<p style=\"padding-left: 30px;\">B = the sum of the Seed Points of the 5 best seeded starters</p>\r\n<p style=\"padding-left: 30px;\">C = the sum of the Race Points of the 5 best seeded competitors in the first 10 finishers</p>\r\n<p>There are minimum Race Penalty Points as follows.</p>\r\n<p style=\"padding-left: 30px;\">0 - Open National &amp; European Championships</p>\r\n<p style=\"padding-left: 30px;\">5 - Closed National Championships, Grand Prix races and Club Nationals (2 run)</p>\r\n<p style=\"padding-left: 30px;\">10 - Club Nationals (3 run)</p>\r\n<p>The Result for each race is the competitors Race Points added to the Race Penalty Points.</p>\r\n<p><strong>Seed Points calculation</strong></p>\r\n<p>There are two calculations: (i) mid-season; and (ii) end of season.</p>')
