\n</ul>\r\n<p>Emphasis</p>\r\n<ul>\r\n<li>Developing skiing skills.</li>\r\n<li>Transfer skills to gates.</li>\r\n<li>Start preparation for race season.</li>\r\n</ul>\r\n<p>Issues</p>\r\n<ul>\r\n<li>Athletes should spend 80% of time training and 20% of time race training.</li>\r\n<li>Training time will be split 70% technical training and 30% gates.</li>\r\n<li>New registrations.</li>\r\n<li>Lots of new children coming along for a couple of weeks.</li>\r\n</ul>\r\n<p><strong>Summer</strong></p>\r\n<p>Racing</p>\r\n<ul>\r\n<li>Artificial slope racing season.</li>\r\n</ul>\r\n<p>Training</p>\r\n<ul>\r\n<li>Technical development drills 50% / Gates 50%.</li>\r\n<li>Concentrate on developing the technical and skiing skills of athletes outside of gates.</li>\r\n<li>Groups work at appropriate level for skill and age.</li>\r\n</ul>\r\n<p>Emphasis</p>\r\n<ul>\r\n<li>Continue preparation for race season.</li>\r\n<li>Evaluate early performances and amend training as necessary.</li>\r\n</ul>\r\n<p>Issues</p>\r\n<ul>\r\n<li>Time for individual feedback.</li>\r\n<li>Setting up and running timing.</li>\r\n<li>Ensuring programmes for new Club Members.</li>\r\n</ul>')
