 ,(247,'<h1>Joining Cardiff Ski Club</h1>\r\n<p>As you can see we have skiers of all abilities in the club and we are very keen to see new members of all ages come and join one of the most successful ski clubs in the UK.</p>\r\n<p>We train for 40 weeks a year on a Tuesday evening between 6pm and 7-30pm.</p>\r\n<p>We have three professional coaches who will assess your child’s ability during your first few lessons and they will be trained in the appropriate group. It is worth mentioning at this stage that dry slope skiing can feel quite different to snow and it may take a few weeks for your child to adjust, we would encourage you to try and give it a few weeks for your child to get used to the new surface.</p>\r\n<p>We hire the slope from the ski centre for our 1.5hrs of training so all fees taken are fed directly back into club funds. The hire of equipment is included in your membership.</p>\r\n<p>There are several ways to pay for your membership that I have outlined below:</p>\r\n<ul>\r\n<li>Guest fee = £15 per session (max 2 sessions).</li>\r\n<li>Annual Membership fee = £40 + £10 per session.</li>\r\n<li>Monthly Standing Order = £25 per month (the cheapest option).</li>\r\n<li>Annual fee = £300 per year paid in advance.</li>\r\n</ul>\r\n<p>Please note we only accept payment by cash or cheque.</p>\r\n<p>We have a committee made up of parents and coaches so please feel free to approach any of the following if you have any questions.</p>\r\n<p>Richard Hyett – Chairman, tel. 07875 300068 - Richard.Hyett at cardiff.gov.uk</p>\r\n<p>Cathy Jones – Secretary - cath.jnz at gmail.com</p>\r\n<p>Rowena Criddle – Treasurer - rowena at criddle.com</p>\r\n<p>Robin Kellen – Head coach - robin at snowsportwales.net</p>')
 ,(251,'<h3>Excel Event Race Pontypool 1pm.</h3>\r\n<p>The Excel Event format provides a great opportunity for new and developing competitors to get in some excellent race experience without the pressure of having to finish every run.  The format gives three runs and its the fastest run to count.  The races are run in just a few hours of an afternoon to avoid the need for overnight stops.  There are no medals and no prize giving to chase after, it is just about going as fast as you can!</p>')
